import clr clr.AddReference("System.Xml")
from System import Exception from System import String from System.IO import Path from System.Xml import XmlDocument
def modify_mod_list(configpath, FileId): xmldoc = XmlDocument() xmldoc.Load(configpath)
mods = xmldoc.SelectSingleNode("MyObjectBuilder_Checkpoint/Mods") if mods is None: mods = xmldoc.SelectSingleNode("MyObjectBuilder_WorldConfiguration/Mods")
if mods is None: raise Exception("Could not find Mods section in the specified path")
# Remove mod and save file only if the mod exists in the file modinfo = mods.SelectSingleNode(String.Format("ModItem[PublishedFileId='{0}']", FileId)) if modinfo is not None: mods.RemoveChild(modinfo) xmldoc.Save(configpath)
# First path - Sandbox.sbc configpath1 = Path.Combine(ThisService.RootDirectory, "Instance/Saves/world/Sandbox.sbc") modify_mod_list(configpath1, FileId)
# Second path - Sandbox_config.sbc configpath2 = Path.Combine(ThisService.RootDirectory, "Instance/Saves/world/Sandbox_config.sbc") modify_mod_list(configpath2, FileId)
